import React from 'react'
import ItemCard from '../../components/ui/ItemCard'
import { ThemeContext } from "../../context/Theme";

export const AdminItem = () => {
  return (
    <div className="w-full h-full flex gap-5">
        <div ><ItemCard/></div>
        <div ><ItemCard/></div>
        <div ><ItemCard/></div>
        <div ><ItemCard/></div>
        <div ><ItemCard/></div>
        <div ><ItemCard/></div>
        <div ><ItemCard/></div>
    </div>
  );
};
